import React from "react";
import Quadrado from "./Quadrado";
import Circulo from "./Circulo";

export default () => {
  return (
    <div>
      <div className="container-fluid">
        <div className="row">
          <div className="col">
            <Quadrado w="100px" h="100px" cor="red" />
          </div>

          <div className="col">
            <Circulo w = '100px' h = '100px' cor = 'green' />
          </div>

          <div className="col">
            <Quadrado w="100px" h="100px" cor="pink" />
          </div>

          <div className="col">
            <Circulo w = '100px' h = '100px' cor = 'yellow' />
          </div>
        </div>
      </div>
    </div>
  );
};
